    public static PokemonMove register(int id, String name, PokemonType type, int accuracy, int power, int pp, int priority, String desc) {
        PokemonMove p = new PokemonMove(id, name, type, accuracy, power, pp, priority, desc);
        moves.put(name, p);
        return p;
    }

    public static PokemonMove get(String name){
        return moves.get(name);
    }

